import data from "./data/data.json";
import TimeCard from "./components/TimeCard";

const TimeCards = () =>{
    return(
        <ul>
        {data.map((item) => (
          <TimeCard
            key={Math.random().toString()}
            title={item.title}
            timeframes={item.timeframes}
          />
        ))}
      </ul>
    )
}
export default TimeCards;
